class node:
    def __init__(self, name: str, coords: list[int]):
        self.name: str = name
        self.coords = coords
        self.order: int = -1
        self.order_control: int
        self.final_value: int = -1
        self.final_value_control: int
        self.working: list[int] = []
        self.working_control: int
        self.key_controls: list[int] = []

    def set_order(self, order, canvas: Canvas):
        self.order = order
        canvas.itemconfig(self.order_control, text=order)

    def set_final_value(self, final_value, canvas: Canvas):
        self.final_value = final_value
        canvas.itemconfig(self.final_value_control, text=final_value)

    def working_append(self, working, canvas: Canvas):
        self.working.append(working)
        canvas.itemconfig(self.working_control, text=str(
            self.working).removeprefix('[').removesuffix(']'))


class network:
    def __init__(self):
        self.nodes: dict[str, node] = {}
        self.vertices: dict[str, int] = {}
        self.vertices_control: dict[str, int] = {}
        self.coord_table: dict[str, tuple[int, int]] = {}

    def create_node(self, name, coords):
        self.nodes[name] = node(name, coords)
        self.coord_table[name] = coords

    def create_vertex(self, vertex: str, weight: int):
        self.vertices[vertex] = weight


def pt_pt3(pt1: list[int], pt2: list[int]) -> list[int | float]:
    return [0.3*pt1[0]+0.7*pt2[0], 0.3*pt1[1]+0.7*pt2[1]]


